// Layout.js
import React from 'react';
import Navbar from './NavigationBar/navbar'; // Adjust the path if necessary
import { Outlet } from 'react-router-dom';

const Layout = () => {
    return (
        <div>
            <Navbar /> {/* Corrected component usage */}
            <main>
                <Outlet /> {/* This will render the content of the current route */}
            </main>
        </div>
    );
};

export default Layout;
